import React, { Component } from 'react';
import InfoCard from '../../componentes/InfoCard/InfoCard'
import classes from '../inicioResidente/inicioResidente.css'
import Button from "@material-ui/core/Button";
import {makeStyles} from '@material-ui/core/styles'
import {
    Link
} from "react-router-dom";

const useStyles = makeStyles(theme =>({
    root:{
background:"orange"
    }
}))

class inicioResidente extends Component {

    render() {
        return (
            <div className={classes['body']}>
                <InfoCard name='residente' phone='+57 ### ### ####' numberH='10#' ></InfoCard>
                <div className={classes['buttons']}>
                    <Link to='/'>
                        <Button m={2}
                            size="large"
                            color="primary"
                            variant="contained"
                        >Cerrar sesion</Button>
                    </Link>
                    <Link to='/RegPago'>
                        <Button 
                        m={2}
                            size="large"
                            color="primary"
                            variant="contained"
                        >Pago administracion</Button>
                    </Link>
                    <Link to='/Foro'>
                        <Button m={2}
                            size="large"
                            color="primary"
                            variant="contained"
                        >Foro Residencial</Button>
                    </Link>
                </div>
            </div>
        )
    }

}
export default inicioResidente
